import headerLogoPath from "../images/header__logo.svg";
import React from "react";
import { Routes, Route, Link, } from "react-router-dom";

function Header() {
  return (
    <header className="header">
      <a href="#">
        <img
          src={headerLogoPath}
          className="header__logo"
          alt="логотип шапки"
        />
      </a>
      <Routes>
        <Route path="/sign-up" element={<Link to="/sign-in" className="header__dynamic-link">Войти</Link>}></Route>
        <Route path="/sign-in" element={<Link to="/sign-up" className="header__dynamic-link">Регистрация</Link>}></Route>
      </Routes>
      <div className="header__line" />
    </header>
  );
}

export default Header;
